import CarouselImages from './Carouselimages';

function CarouselImage() {
    const [headlines,setHeadlines] = useState({});
    getHeadlines().then(res =>{
        return res.json()
    }).then(ans =>{
        console.log(ans)
    }).catch(err =>{
        throw err
    })
    return (
        <div class="carousel-inner">
            {headlines.data}
            <CarouselImages active={true}  />
            <CarouselImages/>
            <CarouselImages/>
        </div >
    )
}

function getHeadlines(){
    return fetch("https://newsapi.org/v2/top-headlines?country=us&apiKey=bb5b1c906cb34c1d90fe13b072449dee")
}

export default CarouselImage;
